import Menu from "./components/Menu";
import CardContent from "@mui/material/CardContent";
import { ThemeProvider, createTheme } from "@mui/material/styles";

const darkTheme = createTheme({
  palette: {
    mode: "dark",
  },
});

function App() {
  return (
    <div>
      <ThemeProvider theme={darkTheme}>
        <CardContent>
          <Menu altura={5} />
        </CardContent>
      </ThemeProvider>
    </div>
  );
}

export default App;
